import { Component } from 'react';
import './style.css';


class About extends Component{
    constructor(){
        super()
    }

    render(){
        return(
<div className='about_container'>
                <div className='about_inner_container'>
                    <p id='me_p'>I'M HUSEYN <b>EYVAZOV</b></p>
                    <p id='dev_p'>FRONT-END <b>DEVELOPER</b></p>
                    <span>Hello! My name is Huseyn, and I'm a junior front-end developer. While I'm just starting out in this field, I already have experience and knowledge in HTML, CSS, and JavaScript. I'm also familiar with modern front-end frameworks and libraries, such as React. I'm constantly seeking to improve my skills and learn new things to become a successful front-end developer. In my portfolio, you'll find examples of projects I've created to demonstrate my abilities.</span>
                </div>
</div>
        )
    }
}

export default About;
